●明るさ・色光をシチュエーションに応じて3モードにセレクト。 <Br>極限の明るさを追求する一方でロングライフ性能を実現。  <Br>デルタシステムはまさに最先端HIDコントロールシステムです。 <Br>
●25W / ローワッテージモード <Br>
明るさ ： 約40％DOWN <Br>
色温度 : （K：ケルビン）：約40%UP <Br>
特徴 : 市街地などで他車を幻惑させる事なく省電力走行。色温度（ケルビン）が上がりドレスアップ性アップ。  <Br>
●35W / スタンダードワッテージモード <Br>
明るさ ： 標準 <Br>
色温度 : 標準 <Br>
特徴 : ベストバランスを最大限に考慮。日常の通常走行時に。 <Br>
●55W / ハイワッテージモード <Br>
明るさ ： 約40％UP <Br>
色温度 : （K：ケルビン）：約10%DOWN <Br>
特徴 : 悪天候や山間部の走行など、視界確保に威力を発揮。また、新たなパッシングサインとして。 <Br>
