●耐久性はより重点的に考慮し設計され3年間の製品保証を実現。<Br>
●ガラス管部分にはUVコーティング処理を施しています。<Br>
●コンパクト設計なのでヘッドランプはもちろん、フォグランプまでほとんどの車種へ適合。<Br>
●9V?32Ｖの幅広い電圧に対応、新開発バラスト採用。<Br>
●高電圧を発生させるバラストとイグナイターを専用精密コネクターで脱着可能。<Br>
